(152, 1, '2015-10-19 16:29:31', '2015-10-19 21:29:31', 'Angela Michelle Cox was born in New Providence, the daughter of Rosemary and Christopher Cox, who are now deceased. She was educated in the Government System and pursued higher education at The College of The Bahamas.\nAngela held a desire for helping others and decided to do further studies at the Keiser University of Ft. Lauderdale, where she earned a Science Degree and became a Medical Assistant.\n\nShe returned home in 2003 to render her services, working in several of the main laboratories, clinics and Doctors Hospital. Angela is a proud mother of four, two strong sons and two beautiful daughters.\nResidents of Ft. Charlotte as long as our allegiance to The Bahamas and the Bahamian people is subordinate to our loyalty to political leaders and their parties, we will continue to support and condone their unethical and corrupt behavior\n\nEven when they attempt to realize and justify their unethical and corrupt behavior, they point out the same in the side opposite. In addition, these political leaders and the elite honor class will continue to command, exploit, control and punish us.\n<h4>THIS MUST CHANGE</h4>\nWe must get up off our knees, shed our blind loyalties lift our voices and make them hear us.\nIts time to repossess our votes and put them to better use.\nIf you are ready Fort Charlotte vote for\n<h4>ANGELA M. COX</h4>', 'About Angela Michelle Cox', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2021-05-01 18:25:44', '2021-05-01 16:25:44', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?page_id=152', 0, 'page', '', 0),
(154, 1, '2015-10-19 16:30:43', '2015-10-19 21:30:43', '<aside class=\"widget\">\n	<h3 class=\"heading\">WE NEED YOUR VOTE!</h3>\n\n	<h5><em>Mark your calendar and don\'t forget to show your support.</em></h5>\n\n	<p><img src=\"/themes/frontrunner/demo/wp-content/uploads/sites/2/2015/10/content-vote-date.png\" alt=\"Save the Date!\" height=\"218\" width=\"263\"></p>\n	<p class=\"small\">We\'re getting closer every day so be sure to save the date. If you need help finding your voting location, check the directory of <a href=\"#\">precinct polling places</a> or contact your local Board of Elections for details.</p>\n</aside>\n\n<aside class=\"widget\">\n	<h3 class=\"heading\">VOTER RESOURCES</h3>\n\n	<h5><em>Can I vote?</em></h5>\n	<ul>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Check your voter registration.</a></li>\n	</ul>\n\n	<h5><em>Where do I go to vote?</em></h5>\n	<ul>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Find your polling place.</a></li>\n	</ul>\n\n	<h5><em>Can I vote early?</em></h5>\n	<ul>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Early voting and absentee ballots.</a></li>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Absentee voting requirements.</a></li>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Military and overseas voting.</a></li>\n	</ul>\n\n	<h5><em>I want to help!</em></h5>\n	<ul>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Become a poll worker.</a></li>\n		<li class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Volunteer to hellp the campaign.</a></li>\n		<li class=\"small\"><a href=\"#\"><strong><i class=\"fa fa-chevron-right\"></i> Make a donation!</strong></a></li>\n	</ul>\n</aside>\n\n<aside class=\"widget\">\n	<h3 class=\"heading\">JOIN US</h3>\n\n	<h5><em>Help us to build a better tomorrow.</em></h5>\n\n	<p><img src=\"/themes/frontrunner/demo/wp-content/uploads/sites/2/2015/10/content-volunteer.jpg\" alt=\"Become a volunteer\" height=\"290\" width=\"210\"></p>\n	<p class=\"small\">The road to a victory is long. We need the help of volunteers like you.</p>\n	<p class=\"small\"><a href=\"#\"><i class=\"fa fa-chevron-right\"></i> Start volunteering.</a></p>\n</aside>', 'Pages Sidebar Content', '', 'publish', 'closed', 'closed', '', 'pages-sidebar-content', '', '', '2015-10-19 16:30:43', '2015-10-19 21:30:43', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?post_type=static_block&amp;p=154', 0, 'static_block', '', 0),
(158, 1, '2015-10-19 16:50:25', '2015-10-19 21:50:25', '<p><img class=\"alignnone size-medium wp-image-400\" src=\"http://localhost:8200/wp-content/uploads/2021/04/Preview-Logo-1-300x232.jpg\" alt=\"\" width=\"300\" height=\"232\" /></p>\n<div class=\"intro-wrap\">\n<h1 class=\"text-left\">True Leadership</h1>\n<p class=\"text-left\">Be part of something real.</p>\n</div>\n<p>[political_newsletter]</p>\n<div class=\"continue-link\"><a href=\"/\">Continue to the site  <i class=\"fa fa-arrow-circle-right\"></i></a></div>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Newsletter (landing page)', '', 'publish', 'closed', 'closed', '', 'newsletter', '', '', '2021-05-01 00:16:34', '2021-04-30 22:16:34', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?page_id=158', 0, 'page', '', 0),
(162, 1, '2015-10-19 17:06:39', '2015-10-19 22:06:39', '<p><img class=\"alignnone size-medium wp-image-400\" src=\"http://localhost:8200/wp-content/uploads/2021/04/Preview-Logo-1-300x232.jpg\" alt=\"\" width=\"300\" height=\"232\" /></p>\n<div class=\"intro-wrap\">\n<h1 class=\"text-left\">It Starts Today!</h1>\n<p class=\"text-left\">Help us build a better tomorrow.</p>\n</div>\n<p>[political_quick_donate]</p>\n<div class=\"continue-link\"><a href=\"http://localhost:8200/donation-form/\" data-wplink-url-error=\"true\">Continue to the site  <i class=\"fa fa-arrow-circle-right\"></i></a></div>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Donate (landing page)', '', 'publish', 'closed', 'closed', '', 'donate', '', '', '2021-04-30 20:53:00', '2021-04-30 18:53:00', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?page_id=162', 0, 'page', '', 0),
(167, 1, '2015-10-19 17:28:41', '2015-10-19 22:28:41', '<h1>Support the Campaign</h1>\n\n<p class=\"lead\">Your contributions make this campaign possible.</p>\n\nOur campaign has come a long way, but there is still a lot of road ahead. Now is the time for us to push on and continue this incredible movement. Please make a donation now and help us win!\n\n[ninja_forms id=99]', 'Donation Form', '', 'publish', 'closed', 'closed', '', 'donation-form', '', '', '2015-10-19 17:28:41', '2015-10-19 22:28:41', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?page_id=167', 0, 'page', '', 0),
(176, 1, '2015-10-19 17:53:36', '2015-10-19 22:53:36', '<p class=\"lead\">Find out what else you can do to help the campaign.</p>\n\nBecome a volunteer, attend a meet up, tell your friends and neighbors! Every bit helps.\n\n<hr>\n\n[static_content id=\"pages-sidebar-content\"]', 'Thank You for Donating!', '', 'publish', 'closed', 'closed', '', 'thank-you-for-donating', '', '', '2015-10-19 17:53:36', '2015-10-19 22:53:36', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?page_id=176', 0, 'page', '', 0);
