(184, 1, '2015-10-19 19:21:40', '2015-10-20 00:21:40', '<div class=\"row\">\n\n	<div class=\"col-md-6\">\n\n		<header class=\"page-header\">\n			<h1 class=\"page-title\">Contact the Campaign</h1>\n		</header>\n\n		<p>Contact us today and find out what you can do to help us make a better tomorrow. We are eager to hear from you.</p>\n\n		<br><br>\n\n		[ninja_forms id=91]\n\n		<br> &nbsp; <br>\n\n	</div>\n\n	<div class=\"col-md-4 col-md-offset-2\">\n		<div class=\"sidebar-container\">\n\n			<aside class=\"widget\">\n				<h3 class=\"heading\">VOLUNTEER</h3>\n\n				<h5><em>Get involved and help the campaign!</em></h5>\n				<p>We need your support to take this campaign to the next level and win. See how you can help.</p>\n				<a href=\"/themes/frontrunner/demo/volunteer/\" class=\"small\">Find out more</a>\n			</aside>\n\n			<aside class=\"widget\">\n				<h3 class=\"heading\">MAKE A DONATION</h3>\n\n				<h5><em>Help us fund the effort.</em></h5>\n				<p>Your contributions are what make all this possible. Every donation helps so don\'t wait!</p>\n				<a href=\"/themes/frontrunner/demo/donation-form/\" class=\"small\">Donate Now!</a>\n			</aside>\n\n			<aside class=\"widget\">\n				<h3 class=\"heading\">WE\'RE HIRING!</h3>\n\n				<h5><em>Job openings and internships.</em></h5>\n				<p>Apply for a job with the campaign or in one of our local offices or the internship program.</p>\n				<a href=\"/themes/frontrunner/demo/volunteer/\" class=\"small\">Apply Here</a>\n			</aside>\n\n			<aside class=\"widget\">\n				<h3 class=\"heading\">OFFICE LOCATIONS</h3>\n\n				<h5><em>Main Office</em></h5>\n				<p>1773 Tea Street <br> Boston, MA 02114</p>\n				<h5><em>Philadelphia</em></h5>\n				<p>1776 Independence Blvd <br> Philadelphia, PA 19107</p>\n			</aside>\n\n		</div> <!-- end sidebar -->\n	</div> <!-- end column -->\n\n</div>', 'Contact', '', 'publish', 'closed', 'closed', '', 'contact', '', '', '2015-10-19 19:21:40', '2015-10-20 00:21:40', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?page_id=184', 0, 'page', '', 0),
(197, 1, '2015-10-19 20:19:41', '2015-10-20 01:19:41', 'An enjoyable day with the candidate and his family. Many pressing issues will be addressed. Collaboratively administrate empowered markets via plug-and-play networks. Dynamically procrastinate B2C users after installed base benefits. Dramatically visualize customer directed convergence without revolutionary.\n\nEfficiently unleash cross-media information without cross-media value. Quickly maximize timely deliverables for real-time schemas. Dramatically maintain clicks-and-mortar solutions without functional solutions.\n\n', 'South-End Brewery Event', '', 'publish', 'closed', 'closed', '', 'south-end-brewery-event', '', '', '2015-10-19 20:19:41', '2015-10-20 01:19:41', '', 0, 'http://para.llel.us/themes/frontrunner/demo/?post_type=political-event&amp;p=197', 0, 'political-event', '', 0),
