(448, 1, '2021-05-01 03:01:59', '2021-05-01 01:01:59', 'Angela Michelle Cox was born in New Providence, the daughter of Rosemary and Christopher Cox, who are now deceased. She was educated in the Government System and pursued higher education at The College of The Bahamas.\nAngela held a desire for helping others and decided to do further studies at the Keiser University of Ft. Lauderdale, where she earned a Science Degree and became a Medical Assistant.\n\nShe returned home in 2003 to render her services, working in several of the main laboratories, clinics and Doctors Hospital. Angela is a proud mother of four, two strong sons and two beautiful daughters.\nResidents of Ft. Charlotte as long as our allegiance to The Bahamas and the Bahamian people is subordinate to our loyalty to political leaders and their parties, we will continue to support and condone their unethical and corrupt behavior\n\nEven when they attempt to realize and justify their unethical and corrupt behavior, they point out the same in the side opposite. In addition, these political leaders and the elite honor class will continue to command, exploit, control and punish us.\n<h4>THIS MUST CHANGE</h4>\nWe must get up off our knees, shed our blind loyalties lift our voices and make them hear us.\nIts time to repossess our votes and put them to better use.\nIf you are ready Fort Charlotte vote for\n\n<img src=\"/themes/frontrunner/demo/wp-content/uploads/sites/2/2015/10/content-family-photo.jpg\" alt=\"Family photo\" width=\"750\" height=\"381\" />\n<h4>A Love for Education</h4>\nBeginning his educational career, Tim was a problem child. He was known for his bad grades and having a habit of getting into trouble. Thanks to the efforts of an exceptional First Grade teacher he began to appreciate reading, and saw his grades improved dramatically. He started to develop what would become a life-long love affair with learning. Young Tim excelled in high school and upon completion, went on to attend college at Stanford University.\n<blockquote>Bow ties are cool. Oh, I always rip out the last page of a book. Then it doesn\'t have to end. I hate endings!</blockquote>\n<h4>Career Success</h4>\nJust as we must expand economic opportunity today, we need to invest in the next generation, which is why Tim founded the Hawthorne Manufacturing Exchange in his home town. The Exchange creates products that help other businesses to grow and reduce costs, while also preparing workers future career opportunities. The company brings cutting-edge manufacturing technology to the region and helps individuals go on to high paid technical jobs.', 'About Angela Michelle Cox', '', 'inherit', 'closed', 'closed', '', '152-revision-v1', '', '', '2021-05-01 03:01:59', '2021-05-01 01:01:59', '', 152, 'http://localhost:8200/?p=448', 0, 'revision', '', 0),
(449, 1, '2021-05-01 03:02:35', '2021-05-01 01:02:35', 'Angela Michelle Cox was born in New Providence, the daughter of Rosemary and Christopher Cox, who are now deceased. She was educated in the Government System and pursued higher education at The College of The Bahamas.\nAngela held a desire for helping others and decided to do further studies at the Keiser University of Ft. Lauderdale, where she earned a Science Degree and became a Medical Assistant.\n\nShe returned home in 2003 to render her services, working in several of the main laboratories, clinics and Doctors Hospital. Angela is a proud mother of four, two strong sons and two beautiful daughters.\nResidents of Ft. Charlotte as long as our allegiance to The Bahamas and the Bahamian people is subordinate to our loyalty to political leaders and their parties, we will continue to support and condone their unethical and corrupt behavior\n\nEven when they attempt to realize and justify their unethical and corrupt behavior, they point out the same in the side opposite. In addition, these political leaders and the elite honor class will continue to command, exploit, control and punish us.\n<h4>THIS MUST CHANGE</h4>\nWe must get up off our knees, shed our blind loyalties lift our voices and make them hear us.\nIts time to repossess our votes and put them to better use.\nIf you are ready Fort Charlotte vote for\n<h4>ANGELA M. COX</h4>', 'About Angela Michelle Cox', '', 'inherit', 'closed', 'closed', '', '152-revision-v1', '', '', '2021-05-01 03:02:35', '2021-05-01 01:02:35', '', 152, 'http://localhost:8200/?p=449', 0, 'revision', '', 0),
